INSERT INTO `email_sender_emailtemplate` VALUES (6,'Reminder','Reminder: Start your ReadyForAgile Survey ...','info@agileacademy.co','info@agileacademy.co','Greetings {{first_name}}, \\n \\n\n\nWe recently sent you a request to participate in the ReadyForAgile Readiness Assessment and noticed that you have not begun the assessment.\\n \\n\n\nThe Assessment is seeking input from a broad sampling of employees that balances several demographic factors. We know your time is extremely valuable and only ask for your participation because your input is vital.\\n\\n\n\nYour input will help us better understand the culture of the software development community in Incorta so we can best plan and implement the Agile Roadmap.\\n \\n\n\nIf you have any questions about the Assessment, please send us on info@agileacademy.co directly.\\n\\n\n\nAll responses are strictly confidential and anonymous. The assessment period will end on Thursday, May 16.\\n\\n\n\n\nThank you, again, for your support.\\n\\n\n\nKind Regards,\nAgile Academy Team\nwww.agileacademy.co','<p>Greetings {{first_name}},</p>\n<p>We recently sent you a request to participate in the ReadyForAgile Readiness Assessment and noticed that you have not begun the assessment.</p>\n<p>The Assessment is seeking input from a broad sampling of employees that balances several demographic factors. We know your time is extremely valuable and only ask for your participation because your input is vital.</p>\n<p>Your input will help us better understand the culture of the software development community in Incorta so we can best plan and implement the Agile Roadmap.</p>\n<p>If you have any questions about the Assessment, please send us on info@agileacademy.co directly.</p>\n<p>All responses are strictly confidential and anonymous. The assessment period will end on Thursday, May 16.</p>\n<p>Thank you, again, for your support.</p>\n<p>Kind Regards,<br />Agile Academy Team<br />www.agileacademy.co</p>'),(7,'Preview reminder','Reminder: Test your ReadyForAgile Survey','info@agileacademy.co','info@agileacademy.co','Dear {{first_name}},\n\nThank you for starting your ReadyForAgile survey - Now it\'s time to finish up!\n\nWe at {{company}} are assessing our Agility and as a crucial part of our team, your opinion is not only valued, it\'s essential.\n\nWe need you to please finish up with the remainder of your survey as soon as you can.\n\nKind Regards,\n{{company}}','<p>Dear {{first_name}},</p>\n<p>Thank you for starting your ReadyForAgile survey - Now it\'s time to finish up!</p>\n<p>We at {{company}} are assessing our Agility and as a crucial part of our team, your opinion is not only valued, it\'s essential.</p>\n<p>We need you to please finish up with the remainder of your survey as soon as you can.</p>\n<p>Kind Regards,<br />{{company}}</p>'),(8,'welcome email','Welcome! Start your ReadyForAgile Survey ...','info@agileacademy.co','info@agileacademy.co','Dear {{first_name}},\n\nYou\'ve been invited to take the ReadyForAgile survey for {{company}}! {{company}} has opted to conduct the ReadyForAgile survey to better understand you, your team and your organization\'s agility.\n\nGet started with your survey by going here - https://{{company_url}}\nOnce there, use the following information to login and get started. You will be asked to create a unique new password.\n\nLogin info...\nURL:   https://{{company_url}}\nAccount login:    {{user_name}}\nPassword:    {{password}}\n\nIf at any point you have questions feel free to reach out to your company admin or info@agileacademy.co\n\nKind Regards,\nAgile Academy Team\nwww.agileacademy.co','<p>Dear {{first_name}},</p> <p>You\'ve been invited to take the ReadyForAgile survey for {{company}}! {{company}} has opted to conduct the ReadyForAgile survey to better understand you, your team and your organization\'s agility.</p> <p>Get started with your survey by going here - https://{{company_url}}<br /> Once there, use the following information to login and get started. You will be asked to create a unique new password.</p> <p>Login info...<br /> URL: https://{{company_url}}<br /> Account login: {{user_name}}<br /> Password: {{password}}</p> <p>If at any point you have questions feel free to reply back to info@agileacademy.co</p> <p>Kind Regards,<br /> Agile Academy Team<br /> www.agileacademy.co</p>'),(9,'forgot_password','ReadyForAgile Password Reset Information','info@agileacademy.co','noreply@agileacademy.co','Dear {{first_name}},\n\nYou have received this email because of a request to update your log-in credentials for your ReadyForAgile Assessment account. If this email has been sent to you in error please disregard.\n\nTo reset your ReadyForAgile Log-in information please follow the link below:\n\n{{reset_password_url}}\n\nIf you have any further questions feel free to reach out to your company admin or info@agileacademy.co\n\nKind Regards,\nAgile Academy Team\nwww.agileacademy.co','<p>Dear {{first_name}},</p>\n<p>You have received this email because of a request to update your log-in credentials for your ReadyForAgile Assessment account. If this email has been sent to you in error please disregard.</p>\n<p>To reset your ReadyForAgile Log-in information please follow the link below:</p>\n<p>{{reset_password_url}}</p>\n<p>If you have any further questions feel free to reach out to your company admin or info@agileacademy.co</p>\n<p>Kind Regards,<br />Agile Academy Team<br />www.agileacademy.co</p>'),(10,'view_results','ReadyForAgile Assessment Results','info@agileacademy.co','info@agileacademy.co','Congratulations Admin,\n\nYour Dr. Agile Survey has been successfully closed. You can now generate reports based on the information provided by your organization and team members.\n\nAs you begin to go through your reports you may have questions. If so, feel free to contact us at Agile Academy and we\'ll help.\n\nKind Regards,\nAgile Academy Team.\n','<p>Congratulations Admin,</p>\n<p>Your Dr. Agile Survey has been successfully closed. You can now generate reports based on the information provided by your organization and team members.</p>\n<p>As you begin to go through your reports you may have questions. If so, feel free to contact us at Agile Academy and we\'ll help.</p>\n<p>Kind Regards,<br />Agile Academy Team.</p>'),(11,'payment_receipt','Thank you from ReadyForAgile!','info@agileacademy.co','info@agileacademy.co','Dear *|company|*,\r\n\r\nWow! Thanks for signing up today. How\'s it feel? \r\n\r\nAgile should be fun, efficient and high-performing, by choosing your plan today you\'ve made a statement - \"I will become agile.\" Now you may be saying, \"I\'m already agile,\" and that may be true but today you\'ve begun a journey to high-performance agile and that is very different beast. \r\n\r\nTo get started with Dr. Agile:\r\nStep 1: Setup your account at *|companyurl|*\r\nStep 2: Monitory your progress\r\nStep 3: Analyze Results\r\nStep 4: Next Steps \r\n\r\nWe are grateful for your business and hope we will have several opportunities to prove our commitment to you the customer. We are currently working furiously to improve our tool and are challenging ourselves to expand functionality all the time. \r\n\r\nSincerely,\r\nDr. Agile Customer Support ','Dear *|company|*,\r\n\r\nWow! Thanks for signing up today. How\'s it feel? \r\n\r\nAgile should be fun, efficient and high-performing, by choosing your plan today you\'ve made a statement - \"I will become agile.\" Now you may be saying, \"I\'m already agile,\" and that may be true but today you\'ve begun a journey to high-performance agile and that is very different beast. \r\n\r\nTo get started with Dr. Agile:\r\nStep 1: Setup your account at *|companyurl|*\r\nStep 2: Monitory your progress\r\nStep 3: Analyze Results\r\nStep 4: Next Steps \r\n\r\nWe are grateful for your business and hope we will have several opportunities to prove our commitment to you the customer. We are currently working furiously to improve our tool and are challenging ourselves to expand functionality all the time. \r\n\r\nSincerely,\r\nDr. Agile Customer Support '),(12,'Invitee Welcome Email','ReadyForAgile Assessment for {{company}}','info@agileacademy.co','info@agileacademy.co','Dear {{first_name}},\n\n You\'ve been invited to take the ReadyForAgile survey for {{company}}! {{company}} has opted to conduct the ReadyForAgile survey to better understand you, your team and your organization\'s agility.\n\n Get started with your survey by going here - https://{{company_url}}\n Once there, use the following information to login and get started. You will be asked to create a unique new password.\n\n Login info...\n URL:   https://{{company_url}}\n Account login:    {{user_name}}\n Password:    {{password}}\n\n If at any point you have questions feel free to reach out to your company admin or info@agileacademy.co\n\n Kind Regards,\n Agile Academy Team\n www.agileacademy.co','<p>Dear {{first_name}},</p> <p>You\'ve been invited to take the ReadyForAgile survey for {{company}}! {{company}} has opted to conduct the ReadyForAgile survey to better understand you, your team and our organization\'s agility.</p> <p>Get started with your survey by going here - https://{{company_url}}<br /> Once there, use the following information to login and get started. You will be asked to create a unique new password.</p> <p>Login info...<br /> URL: https://{{company_url}}<br /> Account login: {{user_name}}<br /> Password: {{password}}</p> <p>If at any point you have questions feel free to reply back to info@agileacademy.co</p> <p>Kind Regards,<br /> Agile Academy Team<br /> www.agileacademy.co</p>'),(13,'pdf','ReadyForAgile Assessment for {{company}}','info@agileacademy.co','info@agileacademy.co','Dear {{first_name}},\n\nKindly find the attached Report pdf file.\n\nIf at any point you have questions feel free to reach out to your company admin or info@agileacademy.co\n\nKind Regards,\nAgile Academy Team\nwww.agileacademy.co\n','<p>Dear {{first_name}},</p>\n<p>Kindly find the attached Report pdf file.</p>\n<p>If at any point you have questions feel free to reach out to your company admin or info@agileacademy.co</p>\n<p>Kind Regards,<br />Agile Academy Team<br />www.agileacademy.co</p>'),(14,'ReminderInProgress','Reminder: Start your ReadyForAgile Survey ...','info@agileacademy.co','info@agileacademy.co','Dear {{first_name}},\n\nThank you for starting your ReadyForAgile survey - Now it\'s time to finish up!\n\nWe at {{company}} are assessing our Agility and as a crucial part of our team, your opinion is not only valued, it\'s essential.\n\nIf you have any questions about the Assessment, please contact Muhammad Elkharashy, Operations Director, or email us on info@agileacademy.co directly.\n\nAll responses are strictly confidential and anonymous. The assessment period will end on Thursday, May 16.\n\nThank you, again, for your support.\n\nKind Regards,\nAgile Academy Team\nwww.agileacademy.co','<p>Dear {{first_name}},</p>\n<p>Thank you for starting your ReadyForAgile survey - Now it\'s time to finish up!</p>\n<p>We at {{company}} are assessing our Agility and as a crucial part of our team, your opinion is not only valued, it\'s essential.</p>\n<p>If you have any questions about the Assessment, please contact Muhammad Elkharashy, Operations Director, or email us on info@agileacademy.co directly.</p>\n<p>All responses are strictly confidential and anonymous. The assessment period will end on Thursday, May 16.</p>\n<p>Thank you, again, for your support.</p>\n<p>Kind Regards,<br />Agile Academy Team<br />www.agileacademy.co</p>');
