INSERT INTO `survey_characteristic` VALUES (287,'COR_WCR','Willingness to collaborate on requirements','Whether or not developers and businesses are open to collaborating with on the requirements.  ',11),(288,'COR_BICR','Buy-In to collaborate on requirements','Managers, PMs/CAMs, and Bas see the value in collaborating on requirements',11),(289,'EST_BIE','Buy-In for Group Estimation','Whether or not the team is willing to take responsibility for making the estimates',11),(290,'EST_REL','Engagement in Relative Estimation','s',4),(291,'EST_TCE','Estimating with the Business','s',11),(292,'VBD_BIV','Buy-In for Value Based Documentation','Whether or not the team is willing to work with documentation that adds value ',13),(293,'VBD_UVD','Understanding of VBD ','Whether or not the team understands what is VBD and the benefits of it.',10),(294,'VOR_BIV','Buy-in for Value Oriented Requirements','Whether or not the Business supports the development of story mapping and personas',9),(295,'VOR_CVR','Competence of Value Oriented Requirements','Assess the Business stakeholders have the knowledge to develop personas, user stories, slice the stories and create a story map',1),(296,'FTF_CFF','Current use of face to face','To what degree the current organization is communicating face-to-face',10),(297,'FTF_BIF','Buy-In for Face to face communication','Whether or not team is willing to support face to face communication',10),(298,'CHA_UCH','Current use of chartering ','To what degree the current organization is chartering.',1),(299,'CHA_BIC','Team\'s Buy-in for chartering','Whether or not managers are willing to support the chartering process along with delivery team',9),(300,'CHA_BTI','Business\'s willingness to receive team input','Whether or not Business is willing to participate in chartering',11),(301,'APN_PDM','Plan-driven mentality','s',13),(302,'APN_WCP','Willingness to change plans','s',13),(303,'APN_EMP','Employing multiple planning horizons','s',1),(304,'BLG_YCB','Yield control to business','s',11),(305,'BLG_BE','Business Engagement','s',11),(306,'BLG_BIB','Buy-in for maintaing a backlog','s',9),(307,'BLG_UMB','Understanding nature of mainting a backlog','s',1),(308,'FDB_BIF','Buy-in for frequent feedback','s',9),(309,'FDB_UVF','Understanding nature of frequent feedback','s',13),(310,'FDB_UIC','Understanding impact of change','s',13),(311,'FDB_REB','Reasonable expectations from business','s',11),(312,'EMT_TRT','Trust among team members','s',2),(313,'EMT_ETM','Employees\' trust of management','s',2),(314,'EMT_MTE','Management\'s trust of employee','s',2),(315,'EMT_COT','Culture of trust within organization','s',2),(316,'EMT_HRM','Team harmony','s',2),(317,'EMT_TCA','Team commitment and accountability','The team holds each other accountable for their commitment of delivering against the plans and not accepting mediocre work from each other.',2),(318,'PER_UNA','Uncertainty avoidance','x',13),(319,'PER_FER','Acceptance of refactoring','w',13),(320,'PER_CRV','Certainty that requirements evolve','d',13),(321,'PER_BRT','Business representation throughout the project','f',11),(322,'PER_ATP','Availability of analyst throughout the project','f',11),(323,'PER_BIP','Buy-in for progressive elaboration of requirements','f',9),(324,'BDI_PND','Prioritizing Needs','f',11),(325,'G_TSL','Trust Between Silos','s',2),(326,'FDP_PE','Process Existence','s',1),(327,'FDP_RFP','Regard for process','s',1),(328,'FDP_UFD','Familiarity with frequent delivery','s',1),(329,'FDP_HFD','Handling more frequent deliveries','d',9),(330,'FDP_BIF','Buy in for frequent delivery process','s',9),(331,'CGS_ECS','Existence of Coding Standards ','s',8),(332,'CGS_BIC','Buy in for Coding Standards','a',9),(333,'SOT_GST','Generalizing Specialist','s',5),(334,'SOT_RCM','Richness of communication','s',10),(335,'SOT_AOI','Accessibility of information','s',1),(336,'SOT_BIS','Buy-in for self-organized teams','s',9),(337,'SOT_RS','Reward systems','s',4),(338,'SOT_UPC','Understanding project context','s',10),(339,'SOT_ATN','Autonomy','n',2),(340,'TDD_CTD','Competence of Test Driven Development','n',8),(341,'TDD_BIT','Buy-in for Test Driven Development','d',9),(342,'TDD_AT','Automating Tests','d',8),(343,'CNI_BIC','Buy-in for continuous integration','d',9),(344,'CNI_STE','Software tools experience for continuous integration','d',8),(345,'CNI_HCI','Handling continuous integration','r',8),(346,'PPG_MP','Measurement of Productivity','c',4),(347,'PPG_BIP','Buy-In for Paired Programming ','Whether or not people think the  idea  of pair programming  would add value to them',9),(348,'RTP_BIR','Buy-in for retrospectives','Whether or not people buy into the idea of dedicating time to inspect and adapt',9),(349,'RTP_PIC','Process improvement capability','The willingness of people to change their process for better results',1),(350,'TSV_BIT','Buy-in for Task Volunteering','Whether people think that task  volunteering would yield in better performance of the team or not',9),(351,'TSV_CCT1','Experience with task volunteering','This characteristic is looking at whether or not people are being allowed to volunteer for tasks or not',4),(352,'TSV_WCT','Buy-in for Cross-Training Members','This characteristic is looking that people are actually even willing to cross train other people on their team as to spread the knowledge and skill set across the entire team therefore reducing bottlenecks.',9),(353,'TSV_CCT','Cross-Training Opportunities ',' This characteristic looks at whether or not people have the opportunity to cross train other people on their team or not.  essentially this is important for  task volunteering and generalizing specialists ',4),(354,'WIP_BIW','Willingness to limit work in process',' Essentially what this characteristic is looking at is whether or not people understand and buying into the fact that limiting  work in process will reduce the overall time  to complete a task',4),(355,'WIP_CLW','Understanding of Work in Process','This characteristic aims to find out whether people understand that limiting work in progress and avoiding multitasking actually results in getting things done quicker or not',13),(356,'AUT_BIA','Buy-in for automated unit tests','Buy-in for automated unit tests',9),(357,'AUT_CUT','Competency using automated unit tests','Competence for using automated unit tests',8),(358,'PPG_COM','Competency with Paired Programming','s',11);
