INSERT INTO `survey_indicator` VALUES (906,'APN_MT1','Our organization defines project success in terms of the value realized by the business and the #user#, rather than \"delivered on time, on budget, and as specified.\"',20,'sequence'),(907,'APN_MT10','The entire project plan is created at the beginning of the project.',22,'sequence'),(908,'APN_MT11','Project plans are created at a high-level at the beginning of the project and the details are defined at the last responsible moment (Release by release).',20,'sequence'),(909,'APN_MT4','The #business# holds the #delivery team# to the initial set of #requirements# in the #requirements document#, even if the project delivered value to the business and #users# with a different set of #requirements#. ',22,'sequence'),(910,'APN_MT6','Our organization\'s process for planning allows project plans to easily change throughout the project based on emerging information about the project',20,'sequence'),(911,'APN_MT7','Plans and milestone dates are held against the #delivery team# causing resistance to accept any new changes or feedback from the #business#.',22,'sequence'),(912,'APN_MT8','The culture here is to view plans as commitments and with no flexibility for changing them.',22,'sequence'),(913,'APN_MT9','The culture here is to accept regular updates to the project plan based on new and emerging information about the project.',20,'sequence'),(914,'BDI_MT1','As the perception of what they need changes, the #business# is expected to articulate those changes by prioritizing the #requirements# they would like to see developed/delivered next.',20,'sequence'),(915,'BDI_MT2','Regardless of the initial plan, #business# should have the authority to determine which #requirement#s they would like to see developed next.',20,'sequence'),(916,'BDI_MT3','My job\'s effectiveness is challenged if the #business# keeps changing which #requirements# they want to see developed next.',22,'sequence'),(917,'BDI_MT4','It is common to start a project with no prioritization for the #requirements# that are being requested; they are all considered important.',22,'sequence'),(918,'BLG_MT1','#Business# should be responsible for keeping a <b>prioritized</b>, up-to-date list of all work that remains to be done.',20,'sequence'),(919,'BLG_MT2','You are willing to yield control to the #business# to keep an up-to-date and prioritized list of all the work that remains to be for a project.',20,'sequence'),(920,'BLG_MT3','Maintaining an up-to-date and prioritized list of all the work that needs to be done for a project is an effective project management practice. ',20,'sequence'),(921,'BLG_MT4','Maintaining a backlog entails keeping a single up-to-date and prioritized list of all #requirements#, bugs, functional and non-functional business #requirements#, as well as technical team-generated work that needs to be completed to finish the project. This list is used to communicate scope to everyone involved in the project. Based on this definition, I believe we should maintain backlogs for future projects.',20,'sequence'),(922,'BLG_MT5','Our #delivery team# has some mechanism, by which <b>everyone</b> on the project, including the #business#, can find out <b>all</b> the remaining work to complete the project',20,'sequence'),(923,'CGS_MT1','Coding standards are available and accessible within the organization.',20,'sequence'),(924,'CGS_MT2','We adhere to coding standards, even in crunch time.',20,'sequence'),(925,'CGS_MT3','Having a clear coding standard increases collective ownership and collaboration between developers',20,'sequence'),(926,'CHA_MT1','Teams contribute to creating a #charter# for new projects.',20,'sequence'),(927,'CHA_MT2','Collaborating to create a #charter# as a team can add value to a project.',20,'sequence'),(928,'CHA_MT3','Collaborating with the #delivery team# to create a #charter# can add value to a project.',20,'sequence'),(929,'COR_MT1','It is common to start developing a #project# straight from a #requirements document# without a direct conversation between the #business# and #delivery team#',22,'sequence'),(930,'COR_MT2','There is currently sufficient collaboration between the #delivery team# and #business# throughout the project to ensure proper understanding of what needs to be built.',20,'sequence'),(931,'EMT_MT1','In general, people are passionate and unguarded in the discussion of issues.',20,'sequence'),(932,'EMT_MT10','I work in an environment in which I feel free to give feedback to my manager(s)',20,'sequence'),(933,'EMT_MT11','I give my #employees# the space to take risks and stand up for their ideas.',20,'sequence'),(934,'EMT_MT12','I encourage my #employees# to suggest and develop new and better ways of doing things.',20,'sequence'),(935,'EMT_MT13','I frequently seek input from my #employees#',20,'sequence'),(936,'EMT_MT14','Your manager seeks your input frequently',20,'sequence'),(937,'EMT_MT15','Your manager encourages you to suggest and develop new and better ways of doing things',20,'sequence'),(938,'EMT_MT16','Your employees are comfortable speaking to you about difficult issues.',20,'sequence'),(939,'EMT_MT2','Team members quickly and genuinely apologize to one another when they say or do something inappropriate or possibly damaging to the team.',20,'sequence'),(940,'EMT_MT3','Team members openly admit their weaknesses and mistakes.',20,'sequence'),(941,'EMT_MT4','During meetings, the most important and difficult issues are put on the table to be resolved.',20,'sequence'),(942,'EMT_MT5','I have a working relationship with my peers that affords me the ability to communicate disagreement effectively without jeopardizing the relationship. ',20,'sequence'),(943,'EMT_MT6','I am comfortable speaking to my manager about difficult issues.',20,'sequence'),(944,'EMT_MT7','I can make a mistake without feeling that my job is in jeopardy.',20,'sequence'),(945,'EMT_MT8','I work in an environment of openness and trust.',20,'sequence'),(946,'EMT_MT9','I work in an environment in which I feel free to give feedback to my team members',20,'sequence'),(947,'EST_MT1','The entire #delivery team# is involved in the estimation of requirements not just the person assigned to the requirement',20,'sequence'),(948,'EST_MT2','The #delivery team# and #business# should be responsible for estimating the project effort together',20,'sequence'),(949,'EST_MT3','The #business# team and the #delivery team# do not work well together and would have difficulty accurately estimating a backlog together.',22,'sequence'),(950,'EST_MT4','When #delivery team# and #business# discuss the requirements together, it helps us get to a common understanding of what is really needed',20,'sequence'),(951,'EST_MT7','We engage in #relative estimation# instead of #absolute estimation#',20,'sequence'),(952,'FDB_MT1','The #business# should have the opportunity to give feedback throughout the development process, even if it results in change of requirements',20,'sequence'),(953,'FDB_MT2','The team gathers continuous feedback/requests from the #business# throughout the development process.',20,'sequence'),(954,'FDB_MT3','Effective feedback should be primarily based on interacting with working software',20,'sequence'),(955,'FDB_MT4','Delivering planned results (original #requirements#) is more important than delivering desired results (emerging #requirements#)',22,'sequence'),(956,'FDB_MT5','When the #business# adds or changes #requirements# resulting in the increase of the project size/scope, nothing is done regarding resources and schedules to accommodate the impact of the change.',22,'sequence'),(957,'FDB_MT6','When #requirements# are added or changed resulting in an increase in project size/scope, resource allocation or the deadlines and schedule are changed accordingly. ',20,'sequence'),(958,'FDB_MT7','The #business# is reasonable in their demands of what they ask for and when they want to get it.',20,'sequence'),(959,'FDB_MT8','There is a culture here of asking for more without changing deadlines',22,'sequence'),(960,'FDP_MT1','Our procedures and processes are well documented and accessible (e.g RIT, elaboration, requirements, release)',20,'sequence'),(961,'FDP_MT10','Over commitment is common here, causing stress and compromising the quality of our work.',22,'sequence'),(962,'FDP_MT11','To deliver value to the #business# earlier and more frequently, you are willing to integrate more frequently.',20,'sequence'),(963,'FDP_MT12','To deliver value to the #business# earlier and more frequently, you are willing to carry out testing activities (including regression tests and integration testing) more frequently.',20,'sequence'),(964,'FDP_MT2','There is a clear and known software development process in place; software development is not ad hoc or haphazard',20,'sequence'),(965,'FDP_MT3','Our procedures are well documented, yet most people do not follow them',22,'sequence'),(966,'FDP_MT4','Our procedures and processes are obsolete and do not represent the way we actually work',22,'sequence'),(967,'FDP_MT5','We regularly update our procedures and processes',20,'sequence'),(968,'FDP_MT6','If I find a problem with a procedure or process, I know what to do to resolve the issue',20,'sequence'),(969,'FDP_MT7','We deliver projects in an incremental/iterative manner (delivering small, coherent units of functionality)',20,'sequence'),(970,'FDP_MT8','An incremental/iterative approach (delivering small, coherent units of functionality) is better than the traditional/waterfall approach (where everything is delivered together at the end)',20,'sequence'),(971,'FDP_MT9','Having a frequent delivery process entails delivering small pieces of coherent and valuable functionality throughout the entire lifetime of the project. This allows the #business# and developers to deliver value earlier and to learn from what they have delivered.<br><br>Based on the above definition, I am willing, and encourage, the organization to adopt a frequent delivery process.',20,'sequence'),(972,'FTF_MT1','Most of my project-related meetings are #face-to-face# (in person or via video calls).',20,'sequence'),(973,'FTF_MT2','Even if someone is in the same building as I am, email is our default mode of communication.',22,'sequence'),(974,'FTF_MT3','I would like to attend project meetings in person or via video calls as often as possible.',20,'sequence'),(975,'G_MT1','Team members know what their peers are working on and how they contribute to the collective good of the team.',20,'sequence'),(976,'G_MT17','I feel that other silos (organizations, departments, etc.) are not looking out for the entire organization\'s best interest, but more focused on their interests and what makes them look good and stand out',22,'sequence'),(977,'G_MT2','Team members willingly make sacrifices for the good of the team.',20,'sequence'),(978,'G_MT3','People\'s morale are significantly affected when the team fails to achieve their <b>collective team goals.</b>',20,'sequence'),(979,'G_MT4','Project team members are deeply concerned about the prospect of letting down their peers.',20,'sequence'),(980,'G_MT5','Project team members are slow to seek credit for their own contributions, but quick to point out those of others.',20,'sequence'),(981,'G_MT6','Project team members call out one another\'s deficiencies or unproductive behaviors.',20,'sequence'),(982,'G_MT7','Project team members challenge one another about their plans and approaches before seeking involvement of managers',20,'sequence'),(983,'G_MT8','Project team members leave meetings confident that their peers are completely committed to the decisions that were agreed on, even if there was initial disagreement.',20,'sequence'),(984,'G_MT9','Project team members end discussions with clear and specific resolutions and calls to action.',20,'sequence'),(985,'GBR_MT15','As a #business# representative to a #delivery team#, I am committed to unconditionally allocate the time needed to prioritize #requirements# and help answer the #delivery team#\'s questions about the #requirements#',20,'sequence'),(986,'PER_MT1','Our team does not believe in getting started with anything unless everything is finalized upfront. ',22,'sequence'),(987,'PER_MT10','#Business# representative(s) to the #delivery team# are collaborative and accessible.',20,'sequence'),(988,'PER_MT11','#Business# representative(s) to the #delivery team# are good representatives of the #user community#.',20,'sequence'),(989,'PER_MT12','#Business# representative(s) to the #delivery team# are authorized and empowered to make decisions regarding the project.',20,'sequence'),(990,'PER_MT13','Progressive elaboration involves identifying #requirements# at a high level, then continuously specifying the details, over the lifetime of the project, as they emerge and become apparent.<br><br>Based on the above definition, I support the organization engaging in the progressive elaboration of #requirements#.',20,'sequence'),(991,'PER_MT14','Evolutionary design and #refactoring# are encouraged since the #requirements# will always change and often impact the design',20,'sequence'),(992,'PER_MT2','Resources are not committed to a project unless a list of detailed #requirements# is finalized',22,'sequence'),(993,'PER_MT3','#Analysts# are available throughout the project (not just at the beginning) to elicit (gather) the details of each high-level #requirement# before the development team works on it',20,'sequence'),(994,'PER_MT4','You do not mind starting a project knowing that its #requirements# will change in the future.',20,'sequence'),(995,'PER_MT5','With enough effort upfront, all detailed #requirements# can be identified and fixed for the remainder of the project',22,'sequence'),(996,'PER_MT6','All detailed #requirements# must be known upfront to build the proper architecture and design',22,'sequence'),(997,'PER_MT7','Throughout the project the #business# has the full right to change the #requirements# in order to meet their changing needs.',20,'sequence'),(998,'PER_MT8','#Business# is willing to have an active role throughout the project, not just at the beginning and end.',20,'sequence'),(999,'PER_MT9','The #business# is available throughout the project (not just at the beginning) to provide the details of each high-level #requirement# before the development team works on it.',20,'sequence'),(1000,'PPG_MT1','Paired Programming involves having 2 developers work together on one computer. One writes the code and the other reviews and enhances the design. They switch roles frequently. Would you encourage and support such a practice in your team?',20,'sequence'),(1001,'PPG_MT2','How often do you engage in #Paired Programming#?',21,'sequence'),(1002,'PPG_MT3','In #Paired Programming# it may seem that we are paying 2 people to do the work of one. However the claim is that it will produce better quality design and code as well as reduce rework. Would you encourage and support such a practice?',20,'sequence'),(1003,'RTP_MT1','You are willing to dedicate your (or your team members\') time after each release to review how the process could be improved.',20,'sequence'),(1004,'RTP_MT2','You are willing to undergo a process change (resulting in a better process) even if it requires some extra work from the team.',20,'sequence'),(1005,'SOT_MT1','Specialization in terms of skill-sets is promoted as part of the culture.',22,'sequence'),(1006,'SOT_MT10','I have clear access to all the information, data or research necessary to perform my daily tasks in an efficient and timely manner. ',22,'sequence'),(1007,'SOT_MT11','The #delivery team# has a good idea for what the #business# would like them to build <b>and why</b>',20,'sequence'),(1008,'SOT_MT12','Individual-based reward systems are promoted and more widely used than team-based reward system.',22,'sequence'),(1009,'SOT_MT13','Within my organization, teams have the autonomy (independence) to divide tasks among their members.',20,'sequence'),(1010,'SOT_MT14','My team is empowered to determine the best way to accomplish tasks without the manager\'s frequent advising.',20,'sequence'),(1011,'SOT_MT15','Employees are competent and disciplined enough to work in self-organizing teams.',20,'sequence'),(1012,'SOT_MT16','You consider yourself competent and disciplined enough to work in a #self-organizing team#.',20,'sequence'),(1013,'SOT_MT17','You agree that people are fairly rewarded when management regards them as one entity (the team); not addressing individual members',20,'sequence'),(1014,'SOT_MT18','In my experience working on teams, technically strong team members are overburdened.',22,'sequence'),(1015,'SOT_MT19','You like to work on a team that management regards as one entity; not addressing individual team members in rewards or tasks, but as one team.',20,'sequence'),(1016,'SOT_MT2','Specialization in terms of domain knowledge (certain applications, parts of the business) is promoted as part of the culture. ',22,'sequence'),(1017,'SOT_MT3','You are willing to help your team members to achieve team goals even if that entails learning new skills (i.e. applications, languages, etc.)',20,'sequence'),(1018,'SOT_MT4','To allow the collective team to deliver on their commitments, you are willing to allow your employees to learn new skills that are outside of their specialization to support other #application teams#.',20,'sequence'),(1019,'SOT_MT5','Most of my information comes via e-mail',22,'sequence'),(1020,'SOT_MT6','I have regular #face-to-face# contact with my team mates',20,'sequence'),(1021,'SOT_MT7','My team is well versed in virtual operations, including use of video conferencing, #IM# and e-mail',20,'sequence'),(1022,'SOT_MT8','My manager has a team meeting at least once a week where everyone is present either physically or virtually',20,'sequence'),(1023,'SOT_MT9','I get all the information I need to perform my job when I need it',20,'sequence'),(1024,'TDD_MT1','How often do you create unit tests for every piece of code?',21,'sequence'),(1025,'TDD_MT2','I have no problems or challenges creating unit tests for pieces of code',20,'sequence'),(1026,'TDD_MT3','The suite of unit tests that I create is comprehensive and usually encompasses all possible test scenarios',20,'sequence'),(1027,'TDD_MT8','I am willing to accept the #delivery team#\'s learning curve while they improve their development practices',20,'sequence'),(1028,'TDD_MT4','I am willing to accept the learning curve of the development team while they transition to #test-driven development#.',20,'sequence'),(1029,'TDD_MT5','#Test-driven development# will produce better software with fewer bugs',20,'sequence'),(1030,'TDD_MT6','Software tools are available in my organization for creating and maintaining automated test suites.',20,'sequence'),(1031,'TDD_MT7','Instead of integrating the system at the end of the development effort, it is better to regularly integrate the system throughout the whole development process.',20,'sequence'),(1032,'TSV_MT1','You allow your team to choose their own tasks for a project',20,'sequence'),(1033,'TSV_MT2','You have the opportunity to choose your own tasks for a project',20,'sequence'),(1034,'TSV_MT3','You would do a better job choosing your own task on a project instead of being assigned one',20,'sequence'),(1035,'TSV_MT4','You believe that your team would perform better and be more effective if they were to choose their own tasks.',20,'sequence'),(1036,'TSV_MT5','The individuals on the team have the opportunity to train each other',20,'sequence'),(1037,'TSV_MT6','Training other team members will disturb my work',22,'sequence'),(1038,'VBD_MT1','Written documentation is a valuable medium to <b>convey information</b> (e.g., #requirements document#)',22,'sequence'),(1039,'VBD_MT2','The more complete the documentation, the better chances everyone will be on the same page',22,'sequence'),(1040,'VBD_MT3','It would be a wiser use of the team\'s time to produce only those documents that are needed to preserve the system and use more real time communication to convey the information',20,'sequence'),(1041,'VOR_B1','I believe we should be doing everything possible to understand our customers including customer stories or creating a customer \"persona\" to better understand what our client\'s needs are. ',20,'sequence'),(1042,'VOR_B2','I am willing to write #requirements# in terms of the user needs and goals, rather than system specifications',20,'sequence'),(1043,'VOR_B3','I know enough about the end users of our system to identify and describe representative examples of how it\'s used',20,'sequence'),(1044,'VOR_B4','I know enough about the end users of our system to describe their needs',20,'sequence'),(1045,'VOR_B6','In thinking about new functionality for the system, I am able to decompose complex capabilities into simple value-add #requirements# (user stories/stories)',20,'sequence'),(1046,'WIP_MT1','By controlling/reducing the number tasks being actively worked in parallel, more work can be completed overall. ',20,'sequence'),(1047,'WIP_MT2','When teams work on <b>one or two</b> projects at a time, they reduce the overall time to market.',20,'sequence'),(1048,'WIP_MT3','I work on multiple tasks at a time to increase efficiency and finish the project faster',22,'sequence'),(1049,'AUT_MT4','Writing unit tests for code is as important as writing new code for more functionality.',20,'sequence'),(1050,'AUT_MT5','You are willing to commit to writing unit tests while you code for each #requirement# in your code.',20,'sequence'),(1051,'AUT_MT2','You consider yourself competent enough to write good and comprehensive automated tests for the each #requirement# in your code.',20,'sequence'),(1052,'AUT_MT3','It is important to write automated tests for each #requirement# while coding them even if that will take additional time. ',20,'sequence'),(1053,'AUT_MT6','Indicate how often you write automated tests for each #requirement# in your code.',21,'sequence');
