INSERT INTO `survey_macro` VALUES (66,'#user#','Think about who will ultimately use the product/solution/deliverable.'),(68,'#requirements document#','Requirements reflect the Business or customer\'s needs and wants.  On Agile projects, they are typically in the form of User Stories with Acceptance Criteria.'),(69,'#users#','Think about who will ultimately use the product/solution/deliverable.'),(71,'#delivery team#','A project team that consists of persons assigned to work on the product/solution/deliverable of a project all of who will help achieve the objectives. '),(72,'#Management#','Management'),(73,'#Business#','This may be is a client role external to your organization. It may also be an internal Business person who is representing the customer or end user\'s needs and who identifies and prioritizes requirements (user stories).'),(74,'#project#','Whatever project team(s) you\'re currently a part of. '),(76,'#employees#','Your employees. '),(77,'#requirement#','Requirements reflect the Business or customer\'s needs and wants.  On Agile projects, they are typically in the form of User Stories with Acceptance Criteria.'),(78,'#requirements#','Requirements reflect the Business or customer\'s needs and wants.  On Agile projects, they are typically in the form of User Stories with Acceptance Criteria.'),(79,'#relative estimation#','This technique of estimation compares items to each other to determine the relative size instead of estimating items individually. On Agile projects, the unit of relative estimation is most commonly Story Points.  It may also be Ideal Days. For example in relative estimating we might say that Item A is a little smaller than Item B.'),(80,'#absolute estimation#','This technique estimates items indviudally to determine the size. For example, instead of judging if Item A is larger or smaller than Item B, the estimator would look only at Item A and estimate how big it is with no regard to Item B.'),(81,'#Paired Programming#','Paired Programming involves having two developers work together on one computer. One writes the code and the other reviews and enhances the design. They switch roles frequently.'),(82,'#business#','This may be a client role external to your organization. It may also be an internal Business person who is representing the customer or end user\'s needs and who identifies and prioritizes requirements (user stories).'),(83,'#refactoring#','Refactoring consists of improving the internal structure of an existing program\'s source code, while preserving its external behavior.'),(84,'#Analysts#','An employee who examines the needs and concerns of clients/customers and stakeholders to determine where potential problems and opportunities lie'),(87,'#application teams#','These are the teams that are involved with the application development versus the business-oriented teams. '),(88,'#user community#','This is meant to represent the collective group of end users who will ultimately use the product/solution/deliverable.'),(89,'#IM#','The exchange of typed messages between computer users in real time via the Internet.'),(90,'#Test-driven development#','Test-Driven Development (TDD) is a technique whereby automated unit tests are written before the code (it is meant to test) is written. The result is a high coverage of automated tests for the code base. Additionally this solves the challenges of designing for testability.'),(91,'#test-driven development#','Test-Driven Development (TDD) is a technique whereby automated unit tests are written before the code (it is meant to test) is written. The result is a high coverage of automated tests for the code base. Additionally this solves the challenges of designing for testability.'),(92,'#face-to-face#','Meetings that are held in person or via videoconference.'),(93,'#everyone#','This term includes every person on a particular project team. '),(94,'#prioritized# ','An item that has been deemed more important than a related item or piece of work. Often in Agile we discuss delivering the highest-value item first.'),(95,'#last responsible moment#','The key is to make decisions as late as you can responsibly wait because that is the point at which you have the most information on which to base the decision. In software design it means you forgo creating generalized solutions or class structures until you know that they\'re justified or necessary.'),(96,'#self-organizing team#','Teams centered and guided by every member of the team rather than a top-down leadership method indicative of the Project Manager role that is more common on a Traditional/Waterfall project. '),(97,'#user stories#','A user story is one or more sentences in the everyday or business language of the end user or user of a system that captures what a user does or needs to do as part of his or her job function.'),(98,'#charter#','A charter is a high-level summary of the project\'s key determinants, goals, and success factors. It is accessible to all team members, and usually displayed on one wall of the team room as a flipchart-sized sheet of paper');
/*!40000 ALTER TABLE `survey_macro` ENABLE KEYS */;
UNLOCK TABLES;

