INSERT INTO `survey_message` VALUES (1,'welcome','Welcome to the Agile Readiness Assessment. All your answers will remain confidential.'),(2,'logo','blank'),(3,'close','Survey is closed by Administrator.'),(4,'readiness_assessment_optimized','This report is specifically designed to provide a detailed practice reading for your organization. Each practice written in blue can be expanded by selecting the (+) icon. Within, you will find the characteristics which act as qualifiers for the practice expanded. For each practice, you can view your overall rating by hovering over the assessment level bar on the right. As you drill down the same is true for each supplemental characteristic. For example:  Buy-in to collaborate on requirements is an essential element determining your organization\'s ability to effectively collaborate on requirements as a diverse team of professionals. '),(5,'practice_spectrum','This report is specifically designed to evaluate your organization is practice spectrum . In and ideally agile world you would see your organization has practices rank on the upper echelon of the temperature scale on the right. By scrolling over the practices on the right you will reveal the characteristics that comprise each practice as well as your team has mean agility for each. This is indicated by the small gadget immediately to the left of each characteristic.'),(6,'category_radar','This report is specifically designed to evaluate your organization is category radar. In and ideally agile world you would see your organization has practices rank on the upper echelon of the temperature scale on the right. By scrolling over the practices on the right you will reveal the characteristics that comprise each practice as well as your team has mean agility for each. This is indicated by the small gadget immediately to the left of each characteristic.'),(7,'open','Survey is opened by Administrator.'),(8,'role_composition_mapping','Role Composition Mapping');
