INSERT INTO `survey_practice` VALUES (241,'COR','Collaborating on Requirements','Attitudes towards collaboration, especially in developing requirements.'),(242,'EST','Estimating','Estimating is one of the most important practices for agile teams to master; it is the basis of iteration planning and negotiating with the Value Team on iteration commitments. The estimating process is central to helping the team understand each story from the Value Team\'s perspective, to synchronize their individual understanding of the stories, and avoid over-engineering the solution. '),(243,'VBD','Value based documentation','Value based documentation refers to documentation that primarily serves the purpose of preserving information as opposed to conveying information.'),(244,'VOR','Value-Oriented Requirements','Value-oriented requirements encompass the product definition practices of Personas and User Stories. Personas help the Value and Delivery teams to have specific insights about the needs and values of the end users, rather than treating them as generic users.  User stories include the techniques of developing user stories, story slicing and mapping, to create end-to-end user experiences.'),(245,'FTF','Face to Face communication','Face to face communication is about achieving the richest form of communication possible by increasing the number of senses you are using in communication.  The objective of F2F is to get people fully engaged, aligned and building trust.'),(246,'CHA','Chartering','Chartering is the initial step to get a team aligned.  The Chartering process uncovers differences and misunderstanding so everyone is on the same page about the purpose of the team.  Chartering can be done for a team or a project.'),(247,'APN','Adaptive Planning','This practice is in many ways at the heart of what agile promises an organization or team. To be able to respond or react to client demands within a regular and timely manner is to practice adaptive planning. Prioritizing backlog items based on the feedback and response of the marketplace/client. '),(248,'BLG','Maintaining a Backlog','A backlog is a list of features or technical tasks which the team maintains and which, at a given moment, are known to be necessary and sufficient to complete a project or a release.'),(249,'FDB','Frequent feedback','A practice of the general team to demo, solicit and accept client feedback on a regular basis at an interval negotiated with the client directly. '),(250,'EMT','Empowered Motivated Team','A \"team\" in the Agile sense is a small group of people, assigned to the same project or effort, nearly all of them on a full-time basis. A small minority of team members may be part-time contributors, or may have competing responsibilities. The notion of team entails shared accountability: good or bad, the outcomes should be attributed to the entire team rather than to any individual. The team is expected to possess all of the necessary competencies, whether technical (programming, designing, testing) or business (domain knowledge, decision making ability).'),(251,'PER','Progressive Elaboration of Requirements','Not all requirements are gathered at the beginning of the project; they evolve and change over the lifecycle of the product. Requirements iteratively evolve instead of being fully developed in one major specifications effort at the beginning of the project.'),(252,'BDI','Business Driven iterations','A key feature of Agile approaches is the underlying assumption that a project consists excusively of a sequence of iterations, possibly with the exception of a very brief \"vision and planning\" phase prior to development, and a similarly brief \"closure\" phase after it. In general iterations are aligned with calendar weeks, often starting on mondays and ending on fridays; this is more a matter of convenience than an explicit recommendation and many teams adopt different conventions. The fixed length of iterations gives teams a simple way to obtain, based on velocity and the amount of work remaining, a usually accurate (though not very precise) estimation of the project\'s remaining duration.'),(253,'FDP','Frequent Delivery Process','This practice encourages dividing the development effort into releases and each release into iterations. Continuous delivery promotes delivering the product project in small iterations at regular intervals. '),(254,'CGS','Coding Standards','If programmers all adhere to a single coding standard (including everything from tabs vs. spaces and curly bracket placement to naming conventions for things like classes, methods, and interfaces), everything just works better. It\'s easier to maintain and extend code, to refactor it, and to reconcile integration conflicts, if a common standard is applied consistently throughout. The standard itself matters much less than adherence to it. Fortunately, modern IDEs make it trivial to apply many kinds of formatting, even after the fact.'),(255,'SOT','Self-organizing teams','Teams centered and guided by every member of the team rather than a top-down leadership method indicative of the Project Manager role that is more common on a Traditional/Waterfall project.'),(256,'TDD','Test Driven Development','Test-Driven Development (TDD) is a technique whereby automated unit tests are written before the code (it is meant to test) is written. The result is a high coverage of automated tests for the code base. Additionally this solves the challenges of designing for testability.'),(257,'CNI','Continuous Integration ','Teams practicing continuous integration seek two objectives: minimize the duration and effort required by each integration episode and to be able to deliver at any moment a product version suitable for release'),(258,'PPG','Paired Programming','Paired Programming involves having two developers work together on one computer. One writes the code and the other reviews and enhances the design. They switch roles frequently.'),(259,'RTP','Retrospectives','Agile retrospective helps the team examine what went well during the past sprint and identify the areas of improvement for the future sprints.'),(260,'TSV','Task Volunteering ','Task volunteering relates to the way work is designed and digested by members of an agile team. This relates to a larger believe in self-organized teams, a shared responsibility for the workload and the visibility and radiation of work-in-progress and completed. '),(261,'WIP','Limit Work in Process','Work in progress limits are agreed upon by the development team before a project begins and are enforced by the team\'s facilitator. For example, a team may divide the tasks that must be performed for a feature into design, code, test and deploy.  When a WIP limit for a certain task has been reached, the team stops and works together to clear the bottleneck.  The goal of working in this manner is meant to ensure that the entire team takes ownership of the project and produces high quality code.'),(262,'AUT','Automated Unit Tests','The \"build\" in developer parlance consists in the process which, starting from files and other assets under the developers\' responsibility, results in a software product in its final or \"consumable\" form. This may include compiling source files, their packaging into compressed formats (jar, zip, etc.) but also the production of installers, the creation or updating of database schema or data, and so on. The build is \"automated\" to the extent that these steps are repeatable and require no direct human intervention, and can be performed at any time with no information other than what is stored in the source code control repository.');
/*!40000 ALTER TABLE `survey_practice` ENABLE KEYS */;
UNLOCK TABLES;

