INSERT INTO `survey_role` VALUES (396,'Business SME','B','<p class=\"p1\"><span class=\"s1\">This role is suitable for individuals engaged from outside the IT (software development) organization. Individuals in this role commonly are the ones with developed, deep expertise from the business or domain knowledge experience.&nbsp;</span></p>',45564564),(397,'Software Developer','D','<p class=\"p1\"><span class=\"s1\">This role is suitable for individuals creating solutions in response to requirements. They are usually engaged in activities such as (but not limited to), writing of code, customization of the code (especially for COTS products), and writing code for unit testing.&nbsp;</span></p>',0),(398,'Functional Manager','M','<p class=\"p1\"><span class=\"s1\">This role is common in organizations that have a matrix structure in which there are dedicated managers for each main specialization (development, testing, analysis, etc.), \"renting\" their people for particular projects led by project managers, This role is suitable for those individuals engaged in the allocation of people to projects and the HR-required management of the personnel that work on those projects.&nbsp;</span></p>',0),(399,'Project Manager','PM','<p class=\"p1\"><span class=\"s1\">This role is suitable for individuals engaged throughout the project lifetime in project management activities such as reporting, risk mitigation, timeline management and cost control. In many cases this role communicates with the business at the beginning of the project to understand their initial set of requirements and provide high-level estimates and plans. Typically this role is involved with removing impediments the teams has in order to reach their commitments.&nbsp;</span></p>',0),(400,'Analyst, PO','BA','<p class=\"p1\"><span class=\"s1\">This role is suitable for individuals being a liaison between the business and the development team, providing the development team with a deeper understanding of the business domain and customer needs. Analysts also expand customer-provided requirements into detailed requirements needed for the development team. Commonly, the development team relies on the business analyst to answer questions on behalf of the business (or find answers from the business) about confusing, ambiguous, or conflicting requirements.&nbsp;</span></p>\n\n<p class=\"p1\">\nIf you\'re a product owner doing all the above plus deciding on scope/schedule planning and tradeoff decisions, please select this role in the assessment.\n</p>',0),(401,'Architect ','L','<p class=\"p1\"><span class=\"s1\">This role is suitable for individuals engaged in any degree of technical guidance, leadership or mentorship to one or more developers on a team. Individuals selecting this role may commonly participate in requirements gathering and validation activities with the business or the business analysts to discuss the technical implications of the requirements. They also commonly develop technical designs, and approve development artifacts at milestone reviews. They transform the requirements into architecture and design that can be used by the rest of the team to actually create the solution. Architects are typically responsible for matching technologies to the problem being solved.&nbsp;</span></p>\r\n<p class=\"p1\"><span class=\"s1\">If you are a lead, do the above-mentioned activities, in addition to activities of a developer, please select this profile for the assessment &ndash; not the developer role.&nbsp;</span></p>',0),(402,'Quality Analyst','T','<p class=\"p1\"><span class=\"s1\">This role is suitable for individuals engaged in the development and execution of system test plans to verify that software developed meets the customer needs and requirements. Testers use a variety of techniques ranging from keying in data and playing with the system to formalized, automated testing scripts to finding bugs before they&rsquo;re found by end customers. Testers, with scripting and programming background involved with writing automated acceptance tests or automated integration and performance tests should also select this role for the assessment.&nbsp;</span></p>',0),(403,'Director, Sr. Director','DR','<p class=\"p1\"><span class=\"s1\">This role is suitable for individuals responsible for managing multiple, and often conflicting, priorities from projects competing for people, time and budget (as well as other resources). In general this role is more about oversight activities and usually deals with escalations from project teams. If most of your direct reports are line managers or directors, then this is a suitable role for you; otherwise, functional or project manager roles may be more suitable for you in this assessment.</span></p>',0),(404,'Technical Specialty Roles','S','<p>DBA, Specialty Tester, User Experience Analyst, Data Analyst, Compliance or Security Analyst.</p>\r\n<p class=\"p1\"><span class=\"s1\">This role is suitable for individuals engaged in usability, UX design, information security, configuration management, automated or manual deployment, database administration, data analysis, systems integration, administrators, hardware support for deployment and maintenance. People in these roles typically support some technical aspect of the development efforts and the development team but do not have primary responsibility for the functionality or delivery of the application.</span></p>',0);
/*!40000 ALTER TABLE `survey_role` ENABLE KEYS */;
